		"text": "&lt;Silver Horse&gt;\n강남구의 A씨는 남편 B씨와 서울의 한 아파트 상가에서 사진관을 운영하고 있다. 두 사람은 A씨가 어머니로부터 물려 받은 집 한 채로 남 부럽지 않은 결혼생활을 시작하지만 아이들이 태어나고 세상이 변해 가기 시작하면서 삶은 점차 각박 해진다."
